import React from "react";
import { Card } from "react-bootstrap";

const UserList = (props) => {
  const { user } = props;
  console.log("user is ", user);
  return (
    <div>
      {user ? (
        <Card>
          {user.map((item, index) => {
            return (
              <li
                style={{
                  marginTop: "30px",
                  textAlign: "center",
                }}
                key={index}
              >
                {item}
              </li>
            );
          })}
        </Card>
      ) : null}
    </div>
  );
};

export default UserList;
